import React from "react";
import "./styles/account.css";
import AccountGraph from "./AccountGraph";

const Account = () => {
  return (
    <div className="account">
      <div className="card">
        <p>Account</p>
        <p className="end">$500.00</p>
      </div>
      <div></div>
    </div>
  );
};

export default Account;
